var common=require("./common");var fs=require("fs");var path=require("path");function _to(a,b){if(!b){common.error("wrong arguments")}if(!fs.existsSync(path.dirname(b))){common.error("no such file or directory: "+path.dirname(b))}try{fs.writeFileSync(b,this.toString(),"utf8");return this}catch(c){common.error("could not write to file (code "+c.code+"): "+b,true)}}module.exports=_to;